import React from 'react'
import { Link } from "react-router-dom";
import './Home.css';

function Home() {
    return (
        <body class="page">
            <header>
                <h1>qUterus</h1>
                <h2>How well do you know the uterus?</h2>
            </header>
            <div class="content">
                <Link to="quiz">Click to view our quiz page</Link>
                <Link to="aiquiz">Click to view our aiquiz page</Link>
            </div>
        </body>
    );
  }

export default Home;
